import React, {Component} from 'react';
import './Picture.css';
import myPhoto from './MyPhoto.JPG';

//const myPhoto = require('./MyPhoto.JPG');

class Picture extends Component {
	render() {
		return (
			<div  className="tc">
				<img src={myPhoto} alt="Mariia" />
			</div>
			)
	}
}

export default Picture;
